from math import isqrt
def children(n):
    s = str(n)
    return set(int(s[:i]+str(r)+s[j:]) for i in range(len(s)) for j in range(i+1, len(s)+1) if (w:=s[i:j])[0]!='0' and (r:=isqrt(t:=int(w)))**2 == t)
def a(n):
    reach, expand = {n}, [n]
    while expand:
        q = expand.pop()
        for c in children(q):
            if c not in reach:
                reach.add(c)
                expand.append(c)
    return min(reach)
